import React from 'react';
import '../../../bootstrap.min.css';

const Footer = () => {
  return (
    <div id="footer" className="row">
      <div className="col-12">
        <p className="">
          All images are from <a href="https://commons.wikimedia.org/wiki/Main_Page">Wikimedia Commons</a> and are in public domain.
      </p>
      </div>
    </div>
  );
};

export default Footer;
